"""
here are a total of numCourses courses you have to take, labeled from 0 to numCourses - 1. You are given an array
 prerequisites where prerequisites[i] = [ai, bi] indicates that you must take course bi first if you want to take course
 ai.

For example, the pair [0, 1], indicates that to take course 0 you have to first take course 1.

You are also given an array queries where queries[j] = [uj, vj]. For the jth query, you should answer whether the course
 uj is a prerequisite of the course vj or not. Note that if course a is a prerequisite of course b and course b is a
 prerequisite of course c, then, course a is a prerequisite of course c.

Return a boolean array answer, where answer[j] is the answer of the jth query.
"""
from typing import List, Tuple


def check_if_prerequisite(num_courses: int, prerequisites: List[Tuple[int, int]],
                          queries: List[Tuple[int, int]]) -> List[bool]:
    """
    :param num_courses: total number of courses labeled from 0 to n-1
    :param prerequisites: prerequisites to take each course, list of (course_take_before, course_take_after)
    :param queries: list of queries [(course_a, course_b)] asking whether course_a needs to be taken before course_b
    :return: List [whether course_a needs to be taken before course_b]
    """
    # Equivalent to find a path from course_a to course_b in a directed graph
    # modification of Floyd's Algorithm
    take_before: List[List[bool]] = [[False] * num_courses for _ in range(num_courses)]

    for course_a, course_b in prerequisites:
        take_before[course_a][course_b] = True

    for course_k in range(num_courses):
        for course_a in range(num_courses):
            if take_before[course_a][course_k]:
                for course_b in range(num_courses):
                    take_before[course_a][course_b] = take_before[course_a][course_b] or \
                                                      take_before[course_k][course_b]

    return [take_before[course_a][course_b] for course_a, course_b in queries]


